import React from "react";

const Field = ({
  id = false,
  number = false,
  placeholder = false,
  icon = false,
  select = false,
}) => {
  return (
    <label
      htmlFor={id}
      className="inline bg-slate-700 text-slate-200 border-0 text-sm rounded focus-within:ring-1 focus-within:ring-blue-600 w-full px-2 py-2"
    >
      <i className="fal fa-magnifying-glass px-3" />
      <input id={id} type="text" className="allunset bg-slate-700" />
    </label>
  );
};

export default Field;
